Tango Company produces joint products M, N, and T from a joint process. This information concerns a batch produced in April at a joint cost of $120,000: <image>
 How much of the joint cost should be allocated to each joint product using the net realizable value method?
A. M: $57,000; N: $47,000; T: $16,000;
B. M: $57,000; N: $47,000; T: $20,000;
C. M: $60,000: N: $51,996; T: $8,004;
D. M: $60,000: N: $51,996; T: $12,000;
Answer with the option's letter from the given choices directly.
Answer:
